import React from 'react';

import {MDBRow,MDBCol,MDBBtn,MDBContainer} from 'mdbreact';


class Build extends React.Component {
  
  render() {
    
    return (
      <div>
        
          <MDBContainer
            style={{ height: '100%', width: '100%', paddingTop: '1rem' }}
            className='d-flex justify-content-center blue-grey-text align-items-center'
          >
            <MDBRow className=" grey lighten-5 text-center text-md-left mt-1 mt-xl-5 mb-5'">
              
                    <h1 className='h1-responsive font-weight-bold mt-sm-5 p'>
                    A digital web design studio creating modern & engaging online experiences
                    </h1>
                    <h6 className='mb-4'>
                    Separated they live in Bookmarksgrove right at the coast of the Semantics, a large language ocean. 
                    A small river named Duden flows by their place and supplies it with the necessary regelialia.
                    </h6>
                   
                  
              

            </MDBRow>
          </MDBContainer>
        

      </div>
    );
  }
}

export default Build;
